using System;
using System.IO;
using System.Media;
using System.Windows.Forms;

private void PlayBase64Audio(string base64Audio)
{
    try
    {
        byte[] audioBytes = Convert.FromBase64String(base64Audio);
        string tempFilePath = Path.Combine(Path.GetTempPath(), "tempAudio.wav");
        File.WriteAllBytes(tempFilePath, audioBytes);
        using (SoundPlayer player = new SoundPlayer(tempFilePath))
        {
            player.Play();
        }
    }
    catch (Exception ex)
    {
        MessageBox.Show($"Error playing audio: {ex.Message}");
    }
}
string base64Audio = "";
PlayBase64Audio(base64Audio);

